/** @format */

import React from "react";

const App = () => {
  return (
    <div className="color-body font">
      <div className="container d-flex">
        <h2 className="text-center py-4">ادخل طالب جديد</h2>
        <div className="row">
          <div className="col-sm-3">
          <input className="form-control" type="text" placeholder="ادخل اسم الطالب" />
          </div>
          <div className="col-sm-3">
          <input className="form-control" type="text" placeholder="ادخل صف الطالب" />
          </div>
          <div className="col-sm-3">
          <input className="form-control" type="text" placeholder="ادخل هاتف الطالب " />
          </div>
          <div className="col-sm-3">
          <input className="form-control" type="text" placeholder="ادخل عنوان الطالب" />
          </div>
        </div>
        <button type="button" className="btn btn-primary w-25 my-4 p-2 ">إضــــافة</button>
      </div>
    </div>
  );
};

export default App;
